export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},sbJzSwuNsS:{data:{id:2331,attributes:{imdbId:"tt0062479",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZDFlYTI2YWQtN2U5Yy00NWRkLTgxZGQtMTA5MzNhYWMwMzUwXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"},{Source:"Rotten Tomatoes",Value:"20%"},{Source:"Metacritic",Value:"42\u002F100"}],item_lang:{data:{id:2994,attributes:{title:"The Way West",plot:"In the mid nineteenth century, Senator William J. Tadlock leads a group of settlers overland in a quest to start a new settlement in the Western U.S. Tadlock is a highly principled and demanding taskmaster who is as hard on himself as he is on those who have joined his wagon train. He clashes with one of the new settlers, Lije Evans, who doesn't quite appreciate Tadlock's ways. Along the way, the families must face death and heartbreak and a sampling of frontier justice when one of them accidentally kills a young Indian boy.",slug:"the-way-west"}}},books:{data:[{id:11330,attributes:{title:"Fair Land, Fair Land",description:"\"'Fair Land, Fair Land' marks the sequel to A.B. Guthrie, Jr.'s two masterworks, 'The Big Sky' and 'The Way West'. Dick Summers, the frontiersman hero of 'The Way West', heads east from Oregon seeking renewed companionship with Teal Eye, the mother of his child, and retribution from his former compatriot Boon Caudill. Imbued with a rich sense of the impermanence of the idyllic plains, this captivating western epic offers a stirring commentary on a country's physical and spiritual erosion\"--Page 4 of cover",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Falxim4NracC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"1995-09-01",publisher:i,subtitle:c}},{id:11331,attributes:{title:"The Big Sky",description:"Relates the adventures of Boone Caudill, a mountain man in the American West of the mid-nineteenth century.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ZyOUMDEcuuQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2002-01-01",publisher:i,subtitle:"A Novel"}},{id:11332,attributes:{title:"No Second Wind",description:"A harsh winter and a heated land dispute make for a deadly combination in this gripping installment of A. B. Guthrie Jr.’s acclaimed mystery series It’s forty degrees below zero in Midbury, Montana, and the cattle are dying. Not from the frigid temperatures, but under bizarre circumstances that stir up rumors of blood cults and UFOs. As if that weren’t bad enough, a strip-mining company has moved into town with plans to tear apart the land in search of coal. Sheriff Chick Charleston and his loyal sidekick, Jason, try to keep tensions between the outsiders and the locals from boiling over, but when a murder occurs at the Chicken Shack, the miners’ local hangout, the situation threatens to spin out of control. To save a community and a way of life that mean everything to them, the sheriff and Jase must track down a killer whose blood runs as cold as a Great Plains winter.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YyHKBwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:e,publisher:f,subtitle:c}},{id:11333,attributes:{title:"Murder in the Cotswolds",description:"A Montana sheriff solves a quintessentially English mystery in this lively episode in A. B. Guthrie Jr.’s beloved suspense series Sheriff Chick Charleston is used to the big sky, wide-open spaces, and no-nonsense attitude of the American West. But when his wife suggests a trip to England to research her family history, he is happy to tag along. The Cotswolds may not be Montana, but the rolling green hills have a majestic beauty all their own. No sooner does the sheriff begin to relax, however, than his vacation is interrupted by murder. An American tourist is found face down in the Ram’s Head Inn with a knife buried deep in his back. Fearing scandal and international headlines, the local constabulary asks Charleston for help in questioning the other Yankees visiting this quaint country village. He may be a fish out of water, but the sheriff’s hard-won experience and keen understanding of human nature soon lead him deep into a tangled web of local intrigue. Filled with the droll humor, meticulous plotting, and unforgettable character studies that distinguish Guthrie’s award-winning Western fiction, Murder in the Cotswolds provides delightfully unexpected entertainment from one of America’s most acclaimed authors.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PiHKBwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:e,publisher:f,subtitle:c}},{id:11334,attributes:{title:"Playing Catch-Up",description:"A ruthless killer preys on the young women of Montana in this tale of suspense from a pioneer of Western fiction Madame Simone runs a brothel on the outskirts of Overthrust, Montana, an oil town just down the road from the ranching community of Midbury. Her business is serene, discreet, and profitable—until one of her girls is murdered. When his other deputies fail to turn up any leads, Sheriff Chick Charleston asks his college-educated colleague Jason Beard to look into the case. Jase immediately uncovers two vital clues: a mysterious stranger who publicly threatened Laura Jane on the night she was killed and a beloved piece of jewelry missing from her personal effects. Just when Charleston and Jase begin to think they are making progress, however, a teenage girl dies under frighteningly similar circumstances. To find the culprit, the sheriff and his deputy must be patient, cunning, and resourceful. Set against the backdrop of a land whose rugged beauty and vast open spaces attract dreamers and criminals alike, Playing Catch-Up is an engrossing detective story and a tribute to the unique adventure of small-town life in the West.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9CDKBwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:e,publisher:f,subtitle:c}}]}}},meta:{}}},prerenderedAt:1681309581901}}("A. B. Guthrie","movie","",null,"2015-05-26","Open Road Media","series",1,"Houghton Mifflin Harcourt"))